define({"topics":[{"title":"<ph>3.8.2.6.1.1<\/ph>\nSettings for Boot Mode 1 Clients","shortdesc":"<p class=\"shortdesc\">In this Boot mode, the Core Complex boots directly from a specified address in eNVM with no authentication. The start page of Boot mode 1 client cannot be modified.<\/p>","href":"GUID-AE825DD9-DE91-4C39-95B7-F501D59B5932.html#GUID-4ADB1528-5A80-4959-B2AC-6C1711FCF23F","attributes":{"data-id":"GUID-4ADB1528-5A80-4959-B2AC-6C1711FCF23F"},"menu":{"hasChildren":false},"tocID":"GUID-4ADB1528-5A80-4959-B2AC-6C1711FCF23F-d10733e3103","topics":[]},{"title":"<ph>3.8.2.6.1.2<\/ph>\nSettings for Boot Mode 3 Clients (PolarFire SoC)","shortdesc":"<p class=\"shortdesc\">PolarFire SoC supports Boot mode 3. In this Boot mode, you specify the start page in         eNVM. You must specify the public key X and Y. See the following table.<\/p>","href":"GUID-AE825DD9-DE91-4C39-95B7-F501D59B5932.html#GUID-6CB782E2-7DB1-46F3-8187-1EF9AA92F71D","attributes":{"data-id":"GUID-6CB782E2-7DB1-46F3-8187-1EF9AA92F71D"},"menu":{"hasChildren":false},"tocID":"GUID-6CB782E2-7DB1-46F3-8187-1EF9AA92F71D-d10733e3114","topics":[]},{"title":"<ph>3.8.2.6.1.3<\/ph>\neNVM Clients Table","href":"GUID-AE825DD9-DE91-4C39-95B7-F501D59B5932.html#GUID-DA731EEA-51DD-4527-A23E-08480F0DF267","attributes":{"data-id":"GUID-DA731EEA-51DD-4527-A23E-08480F0DF267"},"menu":{"hasChildren":false},"tocID":"GUID-DA731EEA-51DD-4527-A23E-08480F0DF267-d10733e3125","topics":[]}]});